import './App.css';
import Nav from "./Nav";
import Login from "./Login";
import Main from "./Main";
import {User} from "./Requests";
import {Async, useAsync} from "react-async"


function App() {
    var json = User();
    // User().then(function(result) {
    //     console.log(result)
    //     json=result
    // });
    console.log(json)

    const App1 = () => {
        const { data, error, isPending } = useAsync(json)
        if (isPending) return "Loading..."
        if (error) return `Something went wrong: ${error.message}`
        if (data)
            return (
                <div>
                    {data}
                </div>
            )
        return null
    }


    return (
        <div>
            <Async promiseFn={User().then(res => (res.ok ? res : Promise.reject(res)))
                .then(res => res.json())}>
                {({ data, error, isLoading }) => {
                    if (isLoading) return "Loading..."
                    if (error) return `Something went wrong: ${error.message}`

                    if (true)
                        return (
                            <div>
                                <Nav/>
                                {data}
                                <Main/>
                            </div>
                        )

                    return <Nav/>
                }}
            </Async>
            {/*<App1/>*/}
            <script src="js/bootstrap.min.js"></script>
        </div>

    );
}

export default App;
